// Default values
const [x = 0, y = 0, z = 0] = [1, 2];
console.log(z); // 0

// Swapping variables
let a = 1, b = 2;
[a, b] = [b, a];

// Nested arrays
const matrix = [[1, 2], [3, 4]];
const [[a1, a2], [b1, b2]] = matrix;

// Return multiple values
function getCoordinates() {
  return [10, 20, 30];
}
const [x, y, z] = getCoordinates();

// Combine with iteration
