// Mixed imports
import Calculator, { PI, square } from './math.js';

// Namespace import
import * as MathUtils from './math.js';
console.log(MathUtils.PI); // 3.14159
console.log(MathUtils.square(4)); // 16

// Side-effect import
import './polyfills.js';

// Re-export
